                <p style="text-align: justify;"><strong>PROFILE</strong></p>
<p style="text-align: justify;">Born in Zhejiang Province, China, Mr. Qian Mingyang has more than 30 years of experience in oil and gas industry. Prior to his appointment as President Director of PetroChina Indonesia, Mr. Qian served as the President of PetroChina International Investment Australia. His previous positions included Vice President of PetroChina International Iraq Ltd., Planning Manager in CNODC, General Manager of CNODC (Syria), and Deputy Manager at the Greater Nile Petroleum Operating Company (GNPOC).&nbsp;</p>
<p style="text-align: justify;"><strong>BACKGROUND</strong></p>
<p style="text-align: justify;">Mr. Qian graduated from Petroleum University (East China) majoring Bachelor of Engineering and received his master education from University of Texas at Arlington.</p>
<p style="text-align: justify;"><strong>EXPERIENCE</strong></p>
<p style="text-align: justify;">Mr. Qian Mingyang's previous positions included Vice President of PetroChina International Iraq Ltd., Planning Manager in CNODC, General Manager of CNODC (Syria), and Deputy Manager at the Greater Nile Petroleum Operating Company (GNPOC).&nbsp;</p></div></div></div></div><div class="modal fade s_popup_notification_0 modal_shown" tabindex="-1" style="background-color: var(--black-50) !important; display: none;" aria-hidden="true"><div class="modal-dialog d-flex h-auto" role="document"><div class="modal-content oe_structure"><div class="modal-header d-flex justify-content-end"><button type="button" class="close border-0" data-bs-dismiss="modal" style="float: right; font-size: 1.5rem; font-weight: 700; line-height: 1; color: rgb(0, 0, 0); text-shadow: rgb(255, 255, 255) 0px 1px 0px; opacity: 0.5;"><span>×</span></button></div><div class="modal-body"><p style="text-align: justify;"><span style="text-decoration: underline;"><strong class="o_default_snippet_text">VP Business Support - Gusminar</strong></span></p>
<p style="text-align: justify;"><strong class="o_default_snippet_text">PROFILE</strong></p>
<p style="text-align: justify;">Mr. Gusminar is the Vice President Business Support. He graduated from Naval Engineering of Diponegoro University in 2002 and got his international welding engineer certification from International Institute of Welding, BPI Mödling Austria. Mr. Gusminar has worked at PetroChina International Jabung Ltd. since 2005.</p>
<p style="text-align: justify;"><strong class="o_default_snippet_text">BACKGROUND</strong></p>
<p class="o_default_snippet_text" style="text-align: justify;">Mr. Gusminar graduated from Naval Engineering of Diponegoro University in 2002 and got his international welding engineer certification from International Institute of Welding, BPI Mödling Austria.</p>
<p style="text-align: justify;"><strong class="o_default_snippet_text">EXPERIENCE</strong></p>
<p style="text-align: justify;">Mr. Gusminar joined PetroChina International Jabung Ltd. in 2005 as Senior Engineering Superintendent &amp; Welding Engineer. In 2011, he was named as Operation Manager of PetroChina International (Bermuda) Ltd. Mr. Gusminar continued his career as Operation Manager for Joint-Operating Body Pertamina – PetroChina Salawati from 2014 to 2016, and as Operation Support Manager of PetroChina Jabung between 2016 and 2017.</p>
<p>&nbsp;</p></div></div></div></div><div class="modal fade s_popup_notification_0" tabindex="-1" role="dialog" style="background-color: var(--black-50) !important;"><div class="modal-dialog d-flex h-auto" role="document"><div class="modal-content oe_structure"><div class="modal-header d-flex justify-content-end"><button type="button" class="close border-0" data-bs-dismiss="modal" style="float: right; font-size: 1.5rem; font-weight: 700; line-height: 1; color: rgb(0, 0, 0); text-shadow: rgb(255, 255, 255) 0px 1px 0px; opacity: 0.5;"><span>×</span></button></div><div class="modal-body"><p class="o_default_snippet_text" style="text-align: justify;"><span style="text-decoration: underline;"><strong>General Manager Jabung - Wang Heping</strong></span></p>
<p class="o_default_snippet_text" style="text-align: justify;"><strong>PROFILE</strong></p>
<p class="o_default_snippet_text" style="text-align: justify;">Mr. Wang Heping was named as General Manager of PetroChina International Jabung Ltd. in December 2023.</p>
<p class="o_default_snippet_text" style="text-align: justify;"><strong>BACKGROUND</strong></p>
<p class="o_default_snippet_text" style="text-align: justify;">Mr. Wang has more than 28 years’ experience in the management of oil and gas facilities, including 23 years of managing overseas projects. Mr. Wang graduated as Bachelor of Engineering from Guilin Institute of Technology and continued his education in China University of Petroleum where he earned Master of Engineering.</p>
<p class="o_default_snippet_text" style="text-align: justify;"><strong>EXPERIENCE</strong></p>
<p class="o_default_snippet_text" style="text-align: justify;">Prior to his appointment as General Manager Jabung in PetroChina Indonesia, Mr. Wang served as the Vice President at CNPC International (Chad) Co., Ltd., the Vice President of PetroChina (Canada) and Director of Project Management Office of Brion Energy Corp. He also previously worked for Petro Energy E&amp;P Co. Ltd. in Khartoum, Sudan.</p></div></div></div></div><div class="modal fade s_popup_notification_0" tabindex="-1" role="dialog" style="background-color: var(--black-50) !important;"><div class="modal-dialog d-flex h-auto" role="document"><div class="modal-content oe_structure"><div class="modal-header d-flex justify-content-end"><button type="button" class="close border-0" data-bs-dismiss="modal" style="float: right; font-size: 1.5rem; font-weight: 700; line-height: 1; color: rgb(0, 0, 0); text-shadow: rgb(255, 255, 255) 0px 1px 0px; opacity: 0.5;"><span>×</span></button></div><div class="modal-body"><p style="text-align: justify;"><span style="text-decoration: underline;"><strong class="o_default_snippet_text">VP of Finance - Jin Lihao</strong></span></p>
<p style="text-align: justify;"><strong class="o_default_snippet_text">PROFILE</strong></p>
<p style="text-align: justify;">Mr. Jin Lihao began serving as Vice President of Finance in PetroChina International Jabung Ltd. in May 31, 2021.</p>
<p style="text-align: justify;"><strong class="o_default_snippet_text">BACKGROUND</strong></p>
<p class="o_default_snippet_text" style="text-align: justify;">Mr. Jin Lihao earned his Bachelor of Science in Accounting from the Hebei University of Finance and Economics, and his Master of Business Administration from the Beijing Institute of Technology.</p>
<p style="text-align: justify;"><strong class="o_default_snippet_text">EXPERIENCE</strong></p>
<p style="text-align: justify;">Mr. Jin Lihao began his career as an auditor at the Auditing Service Center of CNPC. Before his assignment in Jakarta, Jin served as chief financial officers at CNPC projects in Niger and Oman. He had also served as section chief auditor at CNPC headquarter for 10 years.</p></div></div></div></div><div class="modal fade s_popup_notification_0" tabindex="-1" role="dialog" style="background-color: var(--black-50) !important;"><div class="modal-dialog d-flex h-auto" role="document"><div class="modal-content oe_structure"><div class="modal-header d-flex justify-content-end"><button type="button" class="close border-0" data-bs-dismiss="modal" style="float: right; font-size: 1.5rem; font-weight: 700; line-height: 1; color: rgb(0, 0, 0); text-shadow: rgb(255, 255, 255) 0px 1px 0px; opacity: 0.5;"><span>×</span></button></div><div class="modal-body"><p style="text-align: justify;"><span style="text-decoration: underline;"><strong class="o_default_snippet_text">VP Operation &amp; Development - Yu Jinbao</strong></span></p>
<p style="text-align: justify;"><strong class="o_default_snippet_text">PROFILE</strong></p>
<p style="text-align: justify;">Mr. Yu Jinbao has been working for around 30 years in oil and gas industry, especially on drilling operation and work over projects. Before being appointed as VP Operation &amp; Development, Mr. Yu joined PetroChina Indonesia as Drilling Manager.</p>
<p style="text-align: justify;"><strong class="o_default_snippet_text">BACKGROUND</strong></p>
<p class="o_default_snippet_text" style="text-align: justify;">Mr. Yu graduated from Jianghan Petroleum Institute Jingzhou in Hubei, China.</p>
<p style="text-align: justify;"><strong class="o_default_snippet_text">EXPERIENCE</strong></p>
<p class="o_default_snippet_text" style="text-align: justify;">Before being appointed as VP Operation &amp; Development, Mr. Yu joined PetroChina Indonesia as drilling manager. His other positions include Operation Manager in the Gubostan Operation Company in Baku, Azerbaijan, in 2004. Mr. Yu served as Operation Manager in the Greater Nile Petroleum Operating Company Limited (GNPOC), which is a joint operating company owned by CNPC, PETRONAS, ONGC and SUDPET, in 2013.</p></div></div></div></div></body></html>